import axios from 'axios';
import React,{useEffect,useState} from 'react'
import { useDispatch, useSelector } from "react-redux";
import { houseForSaleAction } from '../store/Actions/HouseFetchAction';
import "../StyleSheet/HouseList.css";

const ForRent = () => {

    
  const url = "/api/house-rent";
  const [houses,setHouses] = useState([]);
  useEffect(() => {
    axios
    .get(url)
    .then((response) => {
      setHouses(response.data);
      console.log(response.data); 
    })
    .catch((error) => {
      console.log(error);
    });
  },[]);


    return (
<div>
    
        <div className='Houses__container'>
          {
            houses && <div className='HouseList__container'>

              {
                houses.map((house) => {
                  return (
            




<div className="House__details" >
<div className="img-conatiner">
                   
                   <img src={house.house_details.house_image} alt="House Picture" />

               </div>
<div className="House__priceAndDetails">
  <h4 className="House__price">HOUSE PRICE : ${house.house_details.price}</h4>
  <h4 className="House__snipDescription">{house.house_details.numOfBedRooms} BHK</h4>
  <h4 className="House__snipDescription">Area : {house.house_location.province}</h4>

</div>
</div>
                  )
                })
              }
              </div>
          }
        </div>
        </div> )
}

export default ForRent
